import * as types from './../constants/ActionTypes'

var initalState = [
    {
        test : 'asv'
    }
];

 var taskReducer = ( state = initalState, action) =>{
    switch(action.type){
        case types.LIST_ALL:
            console.log(state)
            return state;
            default : state;
    }
}

export default taskReducer;
